tables.table_schema:
CREATE TABLE input_data (
    id INT PRIMARY KEY,
    data TEXT
);

CREATE TABLE preprocessed_data (
    id INT PRIMARY KEY,
    input_id INT,
    preprocessed_text TEXT,
    FOREIGN KEY (input_id) REFERENCES input_data(id)
);

CREATE TABLE data_preprocessing (id INT PRIMARY KEY,
    data TEXT,
    preprocessed_data TEXT);

CREATE TABLE data_preprocessing (
    id INT PRIMARY KEY,
    data_input TEXT,
    preprocessed_data TEXT
);

CREATE TABLE neural_network_training (
    id INT PRIMARY KEY,
    input_features TEXT,
    output_labels TEXT
);

CREATE TABLE stored_procedures (
    id INT PRIMARY KEY,
    procedure_name TEXT,
    procedure_description TEXT
);

CREATE TABLE training_history (
    id INT PRIMARY KEY,
    training_id INT,
    training_date DATE,
    training_accuracy DOUBLE
);

CREATE TABLE preprocessed_data (
    id UUID PRIMARY KEY,
    data JSONB
);

CREATE TABLE preprocessing_logs (
    log_id SERIAL PRIMARY KEY,
    preprocessing_timestamp TIMESTAMP,
    processed_data_id UUID,
    log_message TEXT
);

CREATE TABLE neural_network_architecture (
    architecture_id SERIAL PRIMARY KEY,
    architecture_name VARCHAR(255),
    layers JSONB
);

CREATE TABLE training_data (
    data_id UUID PRIMARY KEY,
    input_data JSONB,
    target_data JSONB
);

CREATE TABLE training_logs (
    log_id SERIAL PRIMARY KEY,
    training_timestamp TIMESTAMP,
    trained_model_id UUID,
    log_message TEXT
);
